import React from 'react';
import Header from './Header'


function App() {
  let counter = 0
  function incrementCounter() {
    counter++
  }
  return (
    <>
      <h1>Contador: {counter}</h1>
      <button onClick={incrementCounter}>Incrementar</button>
    </>
  );
}

export default App;
